INSERT INTO public.products VALUES (2, 'Bcaa Mega Caps 300 капсул', 'Для спортсменів силових дисциплін, важкоатлетів і культуристів.', 'data:image/jpeg;base64,', 20, 1400, 10, 3, 2);
INSERT INTO public.products VALUES (18, 'Animal Pak (Енімал Пак)', 'Комплекс вітамінів та мінералів Анімал від Universal Nutrition пропонує відповідність американської якості та доступності ціни. Цей комплекс забезпечить організм білками, мінералами, травними ферментами. До складу препарату входять такі корисні речовини, як протеїн (необхідний росту м''язів), вуглеводи (головне джерело енергії), кальцій (формує кістки) тощо.', 'data:image/jpeg;base64,', 0, 0, 0, 4, 2);
INSERT INTO public.products VALUES (55, 'TESTPRODUCT1', 'DESCRIPTION', '', 1, 100, 10, 9, 2);
INSERT INTO public.products VALUES (11, 'Biotech, BCAA Zero, 360 g', 'Комплекс амінокислот (BCAA Zero) – незамінні амінокислоти в порошку. Анаболічний комплекс на основі глютаміну, лейцину, вітаміну В6, валіну та ізолейцину. Крім амінокислот містить швидкі вуглеводи (глюкоза). Такий склад дозволяє максимально швидко і практично без функціональних втрат «провести» поживні нутрієнти через ШКТ.', 'data:image/jpeg;base64,', 34, 200, 3, 8, 2);
INSERT INTO public.products VALUES (59, 'TESTPRODUCT', 'DESCRIPTION', '', 1, 100, 10, 9, 2);
INSERT INTO public.products VALUES (61, 'TESTPRODUCT', 'DESCRIPTION', '', 1, 100, 10, 9, 2);
INSERT INTO public.products VALUES (19, 'Animal Pak (Енімал Пак)', 'Комплекс вітамінів та мінералів Анімал від Universal Nutrition пропонує відповідність американської якості та доступності ціни. Цей комплекс забезпечить організм білками, мінералами, травними ферментами. До складу препарату входять такі корисні речовини, як протеїн (необхідний росту м''язів), вуглеводи (головне джерело енергії), кальцій (формує кістки) тощо.', 'data:image/jpeg;base64,', 40, 300, 20, 4, 2);
INSERT INTO public.products VALUES (14, 'BCAA Shot zero carb', 'BCAA є важливими будівельними блоками для м’язової тканини, і можуть допомогти збільшити м’язову масу, покращити витривалість та відновлення після тренувань. L-карнітин покращує використання жирів як джерело енергії, а L-аланін допомагає зменшити втому.', 'data:image/jpeg;base64,', 10, 100, 2, 9, 2);
INSERT INTO public.products VALUES (15, 'Creatine Mega Caps 1250 ', 'Creatine Mega 1250 від Olimp Labs - мабуть, найпрактичніший спосіб прийому креатину моногідрату, так як порція становить всього дві капсули, а в кожній міститься 1250 мг креатину .', 'data:image/jpeg;base64,', 30, 230, 10, 3, 2);
INSERT INTO public.products VALUES (16, 'Animal Flex (Анімал Флекс)', '
Приймаючи Анімал Флекс, спортсмен допомагає своїм суглобам справлятися з підвищеними навантаженнями, які є неминучими при посилених тренуваннях. Комплекс сприяє виробленню в організмі спортсмена мастила для суглобів , знеболює та знімає запальний процес. При цьому у складі – лише натуральні інгредієнти.
', 'data:image/jpeg;base64,', 20, 100, 20, 4, 2);
INSERT INTO public.products VALUES (3, 'Biotech, BCAA + B6', 'BCAA+B6 може бути корисною для спортсменів і людей, які займаються фізичною активністю. І хочуть підвищити витривалість, зменшити втому та покращити зростання м’язів. Вітамін B6 може допомогти покращити засвоєння та використання BCAA, що може призвести до кращих результатів.', 'data:image/jpeg;base64,', 10, 600, 10, 5, 2);
INSERT INTO public.products VALUES (22, 'Platinum PRO Crosstrainer', 'н4н54неууру', 'data:image/jpeg;base64,', 0, 12000, 5, 14, 10);
INSERT INTO public.products VALUES (23, 'FitLogic T26C', 'Компактні розміри тренажера 105 х 54 х 140 см роблять його неймовірно зручним і простим у використанні та характеризується високою якістю виготовлення. Має магнітну гальмівну систему і 32-ступінчастий діапазон регулювання опору. Велотренажер можна легко вирівняти ніжками. Завдяки транспортувальним роликам ви зможете швидко перемістити тренажер у будь-яке місце у квартирі. Максимальна вага: 150 кг. Під час тренувань ви зможете дивитися улюблені серіали завдяки тримачу для мобільного пристрою, а також велотренажер York C420 оснащений тримачем для пляшки з водою.', 'data:image/jpeg;base64,', 7, 20000, 3, 16, 12);
INSERT INTO public.products VALUES (21, 'Tunturi FitCross 50i', 'Орбітрек Tunturi FitCross 50i 17TFCR5000 - домашній задньопривідний ергометр з 20-ма різноманітними тренувальними програмами. Завдяки встановленим програмами і функції эргометра, Ви зможете досягти поставленої мети, точно знаючи рівень заданої навантаження. Задній привід тренажера забезпечує більш короткий і більш інтенсивний рух, ніж у передньопривідних орбітреків. Тренажер має підставку для планшета/смартфона. Ви можете завантажити додатки Kinomap, Fit Hi Way або iConsole+ на свій планшет/смартфон і використовувати їх у поєднанні з орбитреком під час тренування. Ця можливість різноманітить Ваші регулярні заняття на кардиотренажере, зробить їх захоплюючими і незабутніми. 32 рівня навантаження эргометра задовольнять як початківця, так і підготовленого спортсмена. Після завершення вправи на орбітреку Ви зможете з легкістю перемістити його в кут кімнати за допомогою транспортувальних коліс.', 'data:image/jpeg;base64,', 10, 10000, 2, 14, 10);
INSERT INTO public.products VALUES (60, 'TESTPRODUCT', 'DESCRIPTION', '', 1, 100, 10, 9, 2);


